import React from "react";
import prueba from "../assets/prueba.png"

import { Container, Row, Col, Breadcrumb } from 'react-bootstrap';
const breadcrumb = {
  marginTop: '16px',
  marginbottom: '16px'
};

const img = {
  width: '180px',
  maxHeight: '180px',
  margin: '16px',
  borderRadius: '4px'
}

const price = {
  fontSize: '24px',
  marginbottom: ''
}

export const Results = () => {
  return (
    <Container fluid>
      <Row>
        <Col md={{ span: 10, offset: 1 }} style={{fontSize: '14px'}}>
          <Breadcrumb style={breadcrumb}>
            <Breadcrumb.Item href="#">Home</Breadcrumb.Item>
            <Breadcrumb.Item href="https://getbootstrap.com/docs/4.0/components/breadcrumb/">
              Library
            </Breadcrumb.Item>
            <Breadcrumb.Item active>Data</Breadcrumb.Item>
          </Breadcrumb>
        </Col>
      </Row>
      <Row>
        <Col className="bg-white" l md={{ span: 2, offset: 1 }}>
          <img src={prueba} alt="logo" style={img}></img>
        </Col>
        <Col className="bg-white" md={6}>
          <p className="price" style={{fontSize: '24px'}}> PRECIO </p>
          <p style={{fontSize: '18px'}}> DESCRIPCIÓN </p>
        </Col>
        <Col className="bg-white" md={2} style={{fontSize: '12px', color: '#999999'}}>
          Ubicación
        </Col>
      </Row>
    </Container>
  );
};
